(3, 'Eric Jones', 'eric@talkwithwebvisitor.com', 'Hello, my names Eric and I just ran across your website at traboon.com...\r\n\r\nI found it after a quick search, so your SEOs working out\r\n\r\nContent looks pretty good\r\n\r\nOne things missing though\r\n\r\nA QUICK, EASY way to connect with you NOW.\r\n\r\nBecause studies show that a web lead like me will only hang out a few seconds  7 out of 10 disappear almost instantly, Surf Surf Surf then gone forever.\r\n\r\nI have the solution:\r\n\r\nTalk With Web Visitor is a software widget thats works on your site, ready to capture any visitors Name, Email address and Phone Number.  Youll know immediately theyre interested and you can call them directly to TALK with them - literally while theyre still on the web looking at your site.\r\n\r\nCLICK HERE http://www.talkwithwebvisitor.com to try out a Live Demo with Talk With Web Visitor now to see exactly how it works and even give it a try it could be huge for your business.\r\n\r\nPlus, now that youve got that phone number, with our new SMS Text With Lead feature, you can automatically start a text (SMS) conversation pronto which is so powerful, because connecting with someone within the first 5 minutes is 100 times more effective than waiting 30 minutes or more later.\r\n\r\nThe new text messaging feature lets you follow up regularly with new offers, content links, even just follow up notes to build a relationship.\r\n\r\nEverything Ive just described is extremely simple to implement, cost-effective, and profitable.\r\n \r\nCLICK HERE http://www.talkwithwebvisitor.com to discover what Talk With Web Visitor can do for your business, potentially converting up to 100X more eyeballs into leads today!\r\n\r\nEric\r\nPS: Talk With Web Visitor offers a FREE 14 days trial  and it even includes International Long Distance Calling. \r\nYou have customers waiting to talk with you right now dont keep them waiting. \r\nCLICK HERE http://www.talkwithwebvisitor.com to try Talk With Web Visitor now.\r\n\r\nIf you\'d like to unsubscribe click here http://talkwithwebvisitor.com/unsubscribe.aspx?d=traboon.com', 'sent', NULL, NULL, NULL, '2020-06-06 22:11:25', '2020-06-06 22:11:25'),
(4, 'Eric Jones', 'eric@talkwithwebvisitor.com', 'Hi, Eric here with a quick thought about your website traboon.com...\r\n\r\nIm on the internet a lot and I look at a lot of business websites.\r\n\r\nLike yours, many of them have great content. \r\n\r\nBut all too often, they come up short when it comes to engaging and connecting with anyone who visits.\r\n\r\nI get it  its hard.  Studies show 7 out of 10 people who land on a site, abandon it in moments without leaving even a trace.  You got the eyeball, but nothing else.\r\n\r\nHeres a solution for you\r\n\r\nTalk With Web Visitor is a software widget thats works on your site, ready to capture any visitors Name, Email address and Phone Number.  Youll know immediately theyre interested and you can call them directly to talk with them literally while theyre still on the web looking at your site.\r\n\r\nCLICK HERE http://www.talkwithwebvisitor.com to try out a Live Demo with Talk With Web Visitor now to see exactly how it works.\r\n\r\nIt could be huge for your business  and because youve got that phone number, with our new SMS Text With Lead feature, you can automatically start a text (SMS) conversation  immediately and contacting someone in that 5 minute window is 100 times more powerful than reaching out 30 minutes or more later.\r\n\r\nPlus, with text messaging you can follow up later with new offers, content links, even just follow up notes to keep the conversation going.\r\n\r\nEverything Ive just described is extremely simple to implement, cost-effective, and profitable. \r\n \r\nCLICK HERE http://www.talkwithwebvisitor.com to discover what Talk With Web Visitor can do for your business.\r\n\r\nYou could be converting up to 100X more eyeballs into leads today!\r\n\r\nEric\r\nPS: Talk With Web Visitor offers a FREE 14 days trial  and it even includes International Long Distance Calling. \r\nYou have customers waiting to talk with you right now dont keep them waiting. \r\nCLICK HERE http://www.talkwithwebvisitor.