(35, 'Hotel Grand Season', 'hotel-grand-season', '<p class=\"text-justify\" style=\"box-sizing: border-box; margin: 0px 0px 1rem; color: #777777; font-family: roboto, sans-serif; font-size: 14px; background-color: #ffffff; text-align: justify !important;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Hotel Grand Season</span>&nbsp;is a standard hotel located at Kalam Road Fizaghat,&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px transparent; color: #5f9afa; text-decoration-line: none; touch-action: manipulation; outline: none;\" href=\"https://guestkor.com/browse/hotels?city=Swat\">Swat</a>, The naturally vibrant location of&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px transparent; color: #5f9afa; text-decoration-line: none; touch-action: manipulation; outline: none;\" href=\"https://guestkor.com/browse/hotels?state=Khyber+Pakhtunkhwa\">Khyber Pakhtunkhwa</a>, The Hotel Grand Season comes with facilities like room service, tv, parking, restaurant, laundry, conference space, power backup, terrace, garden, 24 hour security, close to bazaar that help cater a happening yet relaxing stay. On entering this Hotel Grand Season, you will immediately sense its special intimate atmosphere that makes you feel like being in your own home. Each detail has been passionately chosen and each room deserves a visit.<br style=\"box-sizing: border-box;\" /><br style=\"box-sizing: border-box;\" />The Hotel Grand Season having 22 rooms and the price range is 1500 to 3000 PKR, rooms are equipped with a TV, room service, and a daily room cleaning facility. Each&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px transparent; color: #5f9afa; text-decoration-line: none; touch-action: manipulation; outline: none;\" href=\"https://guestkor.com/browse/hotel/1/hotel-grand-season-Swat-5de09b44824d9?tab=basic\">Bedroom</a>&nbsp;is adequately furnished and tastefully designed. The rooms are spacious and come with large beds and comfortable bedding.<