(132, 'Aljazeera Hotel Fizaghat', 'aljazeera-hotel-fizaghat', '<p><span style=\"color: #5e6d77; font-family: poppins, sans-serif; font-size: 14px; background-color: #ffffff;\">One of our best seller! Aljazeera hotel is located in the heart of Fizaghat 400 m from Mingora bazaar. This newly built and well-furnished hotel has the facility of a restaurant and food can be served to your room too if you like. Free WiFi free private parking is available on site.</span><br style=\"box-sizing: border-box; color: #5e6d77; font-family: poppins, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #5e6d77; font-family: poppins, sans-serif; font-size: 14px; background-color: #ffffff;\">Every room comes with a flat-screen TV with cable channels. Some units have a sitting area to relax in after a busy day. Every room is equipped with a private bathroom fitted with a shower. For your comfort, you will find slippers and free toiletries.</span><br style=\"box-sizing: border-box; color: #5e6d77; font-family: poppins, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #5e6d77; font-family: poppins, sans-serif; font-size: 14px; background-color: #ffffff;\">You will find a 24-hour front desk at the property with the availability of room service.</span><br style=\"box-sizing: border-box; color: #5e6d77; font-family: poppins, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #5e6d77; font-family: poppins, sans-serif; font-size: 14px; background-color: #ffffff;\">The hotel also provides car rental. Fizaghat park is 30 m from Aljazeera hotel and you can enjoy the exotic view of river swat.</span></p>', NULL, 491, 14, 'Fizagat, N-95, Swat, Pakistan', '34.79299501387122', '72.36494728143252', 17, NULL, NULL, NULL, NULL, NULL, 2500.00, NULL, NULL, NULL, NULL, 'publish', 22, NULL, NULL, '2020-07-31 12:14:48', '2020-07-31 12:14:48', NULL, NULL);
