(14, 'Swat', '<p><strong style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">Swat District</strong><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;(</span><a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Pashto language\" href=\"https://en.wikipedia.org/wiki/Pashto_language\">Pashto</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">:&nbsp;</span><span dir=\"rtl\" lang=\"ps\" style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\"> </span><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&lrm;,&nbsp;</span><small style=\"font-size: 11.9px; color: #202122; font-family: sans-serif; background-color: #ffffff;\">pronounced&nbsp;</small><span class=\"IPA\" style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\" title=\"Representation in the International Phonetic Alphabet (IPA)\"><a style=\"color: #0b0080; background: none; text-decoration-line: none !important;\" title=\"Help:IPA\" href=\"https://en.wikipedia.org/wiki/Help:IPA\">[swat]</a></span><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">;&nbsp;</span><a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Urdu language\" href=\"https://en.wikipedia.org/wiki/Urdu_language\">Urdu</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">:&nbsp;</span><span dir=\"rtl\" lang=\"ur\" style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\"><span class=\"Nastaliq\" dir=\"rtl\" style=\"font-family: \'Jameel Noori Nastaleeq\', \'Urdu Typesetting\', \'Noto Nastaliq Urdu\', \'Noto Nastaliq Urdu Draft\', \'Hussaini Nastaleeq\', \'AlQalam Taj Nastaleeq\', IranNastaliq, \'Awami Nastaliq\', \'Awami Nastaliq Beta3\', \'Awami Nastaliq Beta2\', \'Awami Nastaliq Beta1\', \'Nafees Nastaleeq\', \'Nafees Nastaleeq v1.01\', \'Pak Nastaleeq\', PDMS_Jauhar, \'Alvi Lahori Nastaleeq\'; font-size: 15.4px;\" title=\"Nastaliq\"> </span></span><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&lrm;)</span><sup id=\"cite_ref-FOOTNOTEMalala_Yousafzai2013_4-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px; color: #202122; font-family: sans-serif; background-color: #ffffff;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Swat_District#cite_note-FOOTNOTEMalala_Yousafzai2013-4\">[4]</a></sup><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;is a&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Districts of Pakistan\" href=\"https://en.wikipedia.org/wiki/Districts_of_Pakistan\">district</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;in&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Malakand Division\" href=\"https://en.wikipedia.org/wiki/Malakand_Division\">Malakand Division</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;of&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Khyber Pakhtunkhwa\" href=\"https://en.wikipedia.org/wiki/Khyber_Pakhtunkhwa\">Khyber Pakhtunkhwa</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;province in&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Pakistan\" href=\"https://en.wikipedia.org/wiki/Pakistan\">Pakistan</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">. Swat is renowned for its outstanding natural beauty. Centred upon the upper portions of the&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Swat River\" href=\"https://en.wikipedia.org/wiki/Swat_River\">Swat River</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">, Swat was a major centre of early Buddhist thought as part of the&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Gandhara\" href=\"https://en.wikipedia.org/wiki/Gandhara\">Gandhara</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;kingdom, and today is littered with ruins from that era. Swat was home to the last isolated pockets of&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Gandharan Buddhism\" href=\"https://en.wikipedia.org/wiki/Gandharan_Buddhism\">Gandharan Buddhism</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">, which lasted until the 10th century, well after most of the area had converted to&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Islam\" href=\"https://en.wikipedia.org/wiki/Islam\">Islam</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">.</span><sup id=\"cite_ref-:0_5-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px; color: #202122; font-family: sans-serif; background-color: #ffffff;\"><a style=\"text-decoration-line: none; color: #0b0080; background: none;\" href=\"https://en.wikipedia.org/wiki/Swat_District#cite_note-:0-5\">[5]</a></sup><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;Until 1969, Swat was part of&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Swat (princely state)\" href=\"https://en.wikipedia.org/wiki/Swat_(princely_state)\">the Yusafzai State of Swat</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">, a self-governing&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Princely states of Pakistan\" href=\"https://en.wikipedia.org/wiki/Princely_states_of_Pakistan\">princely state</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">.</span></p>', '4', NULL, '34.768691457552706', '72.37099518976633', 9, 'publish', 27, 30, NULL, 1, 1, NULL, NULL, NULL, '2020-07-14 18:01:03', '2020-07-14 18:03:29', 197, NULL),
(15, 'Mingora', '<p><strong style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">Mingora</strong><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;(</span><a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Pashto language\" href=\"https://en.wikipedia.org/wiki/Pashto_language\">Pashto</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">:&nbsp;</span><span dir=\"rtl\" lang=\"ps\" style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\"><span class=\"Nastaliq\" dir=\"rtl\" style=\"font-family: \'Jameel Noori Nastaleeq\', \'Urdu Typesetting\', \'Noto Nastaliq Urdu\', \'Noto Nastaliq Urdu Draft\', \'Hussaini Nastaleeq\', \'AlQalam Taj Nastaleeq\', IranNastaliq, \'Awami Nastaliq\', \'Awami Nastaliq Beta3\', \'Awami Nastaliq Beta2\', \'Awami Nastaliq Beta1\', \'Nafees Nastaleeq\', \'Nafees Nastaleeq v1.01\', \'Pak Nastaleeq\', PDMS_Jauhar, \'Alvi Lahori Nastaleeq\'; font-size: 15.4px;\" title=\"Nastaliq\"></span></span><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&lrm;,&nbsp;</span><em style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">Mingawara</em><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">;&nbsp;</span><a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Urdu language\" href=\"https://en.wikipedia.org/wiki/Urdu_language\">Urdu</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">:&nbsp;</span><span dir=\"rtl\" lang=\"ur\" style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\"><span class=\"Nastaliq\" dir=\"rtl\" style=\"font-family: \'Jameel Noori Nastaleeq\', \'Urdu Typesetting\', \'Noto Nastaliq Urdu\', \'Noto Nastaliq Urdu Draft\', \'Hussaini Nastaleeq\', \'AlQalam Taj Nastaleeq\', IranNastaliq, \'Awami Nastaliq\', \'Awami Nastaliq Beta3\', \'Awami Nastaliq Beta2\', \'Awami Nastaliq Beta1\', \'Nafees Nastaleeq\', \'Nafees Nastaleeq v1.01\', \'Pak Nastaleeq\', PDMS_Jauhar, \'Alvi Lahori Nastaleeq\'; font-size: 15.4px;\" title=\"Nastaliq\"></span></span><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&lrm;) is a city in the&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Swat District\" href=\"https://en.wikipedia.org/wiki/Swat_District\">Swat District</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;of&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Khyber Pakhtunkhwa\" href=\"https://en.wikipedia.org/wiki/Khyber_Pakhtunkhwa\">Khyber Pakhtunkhwa</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;province,&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Pakistan\" href=\"https://en.wikipedia.org/wiki/Pakistan\">Pakistan</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">. Mingora is the&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"List of cities in Khyber Pakhtunkhwa by population\" href=\"https://en.wikipedia.org/wiki/List_of_cities_in_Khyber_Pakhtunkhwa_by_population\">largest city</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;in Swat District,&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"List of cities in Khyber Pakhtunkhwa by population\" href=\"https://en.wikipedia.org/wiki/List_of_cities_in_Khyber_Pakhtunkhwa_by_population\">the 3rd largest city</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">&nbsp;in&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Khyber Pakhtunkhwa\" href=\"https://en.wikipedia.org/wiki/Khyber_Pakhtunkhwa\">Khyber Pakhtunkhwa</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">, and the&nbsp;</span><a class=\"mw-redirect\" style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"List of most populous cities in Pakistan\" href=\"https://en.wikipedia.org/wiki/List_of_most_populous_cities_in_Pakistan\">26th largest city in Pakistan</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">. Mingora is the largest city and the epicenter of social, cultural, and economic activities in&nbsp;</span><a style=\"text-decoration-line: none; color: #0b0080; background: none #ffffff; font-family: sans-serif; font-size: 14px;\" title=\"Malakand Division\" href=\"https://en.wikipedia.org/wiki/Malakand_Division\">Malakand Division</a><span style=\"color: #202122; font-family: sans-serif; font-size: 14px; background-color: #ffffff;\">, and also the largest in the northern part of Khyber Pakhtunkhwa.</span></p>', 'mingora', NULL, '34.77101814118727', '72.36016334614357', 14, 'publish', 28, 29, 14, 1, 1, NULL, NULL, NULL, '2020-07-14 18:07:36', '2020-07-14 18:08:25', 178, NULL);
