(103, 'style_custom_css', 'style', '.bravo-logo > img \r\n{\r\n    width:150px;\r\n}\r\n\r\n.bravo_wrap .bravo_topbar {\r\n    background: #a80505;\r\n    padding: 15px 0;\r\n}\r\n.bravo_wrap .bravo_form .g-field-search {\r\n    flex: 0 0 90%;\r\n    max-width: 90%;\r\n    flex-grow: 1;\r\n   \r\n}\r\n.bravo_wrap .bravo_search_hotel .bravo-list-item .list-item .item-loop-list .g-rate-price {\r\n    flex: 1;\r\n    padding: 60px 15px 15px 50px;\r\n    position: relative;\r\n}\r\n.bravo_wrap .bravo_footer .main-footer {\r\n    background-color: #414955;\r\n    margin: 0px 0;\r\n    color: white;\r\n}\r\n.bravo_wrap .bravo_footer .main-footer .nav-footer .context ul li a {\r\n    margin-bottom: 20px;\r\n    font-size: 14px;\r\n    font-weight: 400;\r\n    display: block;\r\n    color: #ffffff;\r\n    text-decoration: none;\r\n    transition: all .3s;\r\n}\r\n.bravo_wrap .bravo_footer .main-footer .nav-footer .context .contact .c-title {\r\n    color: #b7b7b7;\r\n    margin-bottom: 10px;\r\n}\r\n.bravo_wrap .bravo_footer .mailchimp {\r\n    display: none;\r\n    padding-top: 65px;\r\n    padding-bottom: 40px;\r\n    background: #f5f5f5;\r\n}\r\n.bravo_wrap .bravo_footer .main-footer .nav-footer .context .contact .sub a i {\r\n    color: #ffffff;\r\n    border: 2px solid white;\r\n    padding: 11px;\r\n}\r\n\r\n@media screen and (min-width: 600px) {\r\n  .footer-mobile\r\n  {\r\n      display:none;\r\n  }\r\n}\r\n@media screen and (max-width: 600px) {\r\n  .footer-hide-COMPANY\r\n  {\r\n      display:none;\r\n  }\r\n  .footer-hide-SUPPORT\r\n  {\r\n      display:none;\r\n  }\r\n  .footer-hide-Discover\r\n  {\r\n      display:none;\r\n  }\r\n  .footer-hide-NEED\r\n  {\r\n      display:none;\r\n  }\r\n  .footer-hide\r\n  {\r\n  display:none;\r\n  }\r\n  .bravo_wrap .bravo_footer .main-footer {\r\n    background-color: #ffffff;\r\n    margin: 0px 0;\r\n    color: #868383;\r\n}\r\n}\r\n.list-group-item {\r\n    position: relative;\r\n    display: block;\r\n    padding: 0.75rem 1.25rem;\r\n    margin-bottom: -1px;\r\n     background-color: #fff; \r\n     border: 1px solid rgba(0, 0, 0, 0.0); \r\n}\r\n\r\n\r\n.item {\r\n    /* background: tomato; */\r\n    padding: 5px;\r\n    /* width: 200px; */\r\n    /* height: 150px; */\r\n    /* margin: 10px; */\r\n    /* line-height: 150px; */\r\n    color: white;\r\n    /* font-weight: bold; */\r\n    /* font-size: 3em; */\r\n    text-align: center;\r\n}\r\n.float1 {\r\n  max-width: 1200px;\r\n  margin: 0 auto;\r\n  padding:30px;\r\n}\r\n.float1:after {\r\n  content: \".\";\r\n  display: block;\r\n  height: 0;\r\n  clear: both;\r\n  visibility: hidden;\r\n}\r\n.float-item {\r\n  float: left;\r\n}\r\n.bravo_wrap .page-template-content .bravo-form-search-all {\r\n    padding: 80px 0;\r\n    background-position: 50%!important;\r\n    background-repeat: no-repeat!important;\r\n    background-size: cover!important;\r\n}\r\n.item {\r\n    /* background: tomato; */\r\n    padding: 5px;\r\n    /* width: 200px; */\r\n    /* height: 150px; */\r\n    /* margin: 10px; */\r\n    /* line-height: 150px; */\r\n    color: #828282;\r\n    /* font-weight: bold; */\r\n    /* font-size: 3em; */\r\n    text-align: left;\r\n}', NULL, 1, 1, NULL, '2020-02-10 16:06:15', '2020-06-22 13:42:23'),
